public class HllTest {
  public static void main(String[] args) {
    String sketch =
        "";
    //String sketch =
    //"";
    byte[] bytes = new BigInteger(sketch, 16).toByteArray();
    //String sketch =
    //"";
    //byte[] bytes = Base64.getDecoder().decode(sketch);
    WritableMemory mem = WritableMemory.writableWrap(bytes);
    HllSketch hllSketch = HllSketch.wrap(mem);

    System.out.println(hllSketch);


    //IntBuffer intBuffer = ByteBuffer.wrap(sketch.getBytes(StandardCharsets.UTF_8)).asIntBuffer();
    //byte[] bytes = Base64.getDecoder().decode(sketch);
    IntBuffer intBuffer = ByteBuffer.wrap(bytes).asIntBuffer();
    int log2m = intBuffer.get();
    int numBits = intBuffer.get() >>> 2;
    System.out.println(log2m);
    System.out.println(numBits);
    int[] bits = new int[numBits];
    intBuffer.get(bits);
    HyperLogLog hll = new HyperLogLog(log2m, new RegisterSet(1 << log2m, bits));
    System.out.println(hll);
  }
}
